INSERT INTO `blw_blog` VALUES (1, '2021-03-17 08:02:47', 'Kenaikan Transaksi Produk Kecantikan Hampir 2x Lipat, Blackexpo Store Hadirkan Beauty Dealight', '<div>\r\n<div>Blackexpo Store mencatatkan peningkatan transaksi pada kategori Kecantikan mencapai hampir 2x lipat menjelang akhir 2020 lalu.</div>\r\n<div>&nbsp;</div>\r\n<div>AVP of Category Development for FMCG &amp; Long Tail Categories Blackexpo Store, Jessica Stephanie Jap mengungkapkan, &ldquo;Pembersih wajah, paket perawatan wajah, serum, masker wajah dan krim wajah menjadi beberapa produk kecantikan paling laris di Blackexpo Store.&rdquo;&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Tingginya antusiasme tersebut melatarbelakangi kehadiran Blackexpo Store Beauty Dealight.&nbsp; &ldquo;Kampanye ini adalah upaya Blackexpo Store untuk #SelaluAdaSelaluBisa mempermudah masyarakat mendapatkan berbagai kebutuhan termasuk produk kecantikan,&rdquo; jelas Jessica.</div>\r\n<div>&nbsp;</div>\r\n<div>Blackexpo Store Beauty Dealight, yang berlangsung hingga 5 Maret 2021, juga merupakan panggung bagi pegiat usaha, khususnya UMKM lokal di industri kecantikan seperti Gentle Hour dan Maska Indonesia, untuk mempertahankan bisnis terutama di tengah pandemi lewat pemanfaatan teknologi.</div>\r\n<div>&nbsp;</div>\r\n<div>Gentle Hour Jangkau Pengguna Online Hingga Papua</div>\r\n<div>Gentle Hour merupakan bisnis produk pembersih wajah lokal yang didirikan oleh Jeldine Madjukie, Joyce Arta dan Revata Pingkan pada Agustus 2020. Sejak awal, Gentle Hour memanfaatkan platform digital seperti Blackexpo Store yang memberikan kontribusi signifikan bagi penjualan.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&ldquo;Blackexpo Store membantu kami menjangkau pelanggan lebih jauh bahkan hingga ke Papua. Bahkan kehadiran berbagai kampanye di Blackexpo Store, contohnya Oh Beauty Festival, bisa membuat Gentle Hour semakin dikenal di masyarakat sekaligus meningkatkan penjualan kami menjadi 13x lipat,&rdquo; terang Joyce.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&ldquo;Kami mengikuti kampanye Blackexpo Store Beauty Dealight sebagai salah satu upaya kami untuk terus memenuhi kebutuhan pasar. Selain itu, kami juga terus berinovasi, salah satunya dengan meluncurkan dua produk baru Gentle Hour yang bisa didapatkan secara eksklusif di Blackexpo Store,&rdquo; kata Revata.</div>\r\n<div>&nbsp;</div>\r\n<div>Maska Indonesia, Cepat Beradaptasi Demi Tingkatkan Penjualan</div>\r\n<div>Maska Indonesia, yang didirikan Radiya Banyu dan Almas Hudiya pada 2019 ini, menawarkan sederet pilihan produk skincare berbahan alami.</div>\r\n<div>&nbsp;</div>\r\n<div>&ldquo;Selama pandemi, mengingat masyarakat lebih banyak di rumah, penjualan produk kami di Blackexpo Store justru mengalami peningkatan signifikan,&rdquo; ujar Raditya.</div>\r\n<div>&nbsp;</div>\r\n<div>Almas pun menyampaikan, &ldquo;Selain membuat produk kami semakin dikenal, berbagai kampanye dan fitur TopAds di Blackexpo Store juga membantu mendorong peningkatan transaksi hampir 2x lipat pada September 2020 lalu jika dibandingkan dengan bulan sebelumnya.&rdquo;&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>Beauty Influencer, Affi Assegaf mengatakan, &ldquo;Kini setiap pegiat usaha skincare lokal berlomba menawarkan produk berkualitas yang tidak kalah saing dengan produk asing. Penjualan produk skincare lokal pun meningkat. Ini menandakan tingginya permintaan akan produk lokal di pasaran.&rdquo;</div>\r\n<div>&nbsp;</div>\r\n<div>&ldquo;Saya sangat mengapresiasi Blackexpo Store karena sudah memberikan panggung luas untuk para pegiat usaha lokal di industri kecantikan. Rasa bangga buatan Indonesia memang sudah seharusnya kita pupuk bersama-sama demi membantu pemulihan ekonomi nasional,&rdquo; tutup Affi.</div>\r\n<div>&nbsp;</div>\r\n<div>Melalui Blackexpo Store Beauty Dealight, masyarakat bisa mengakses lebih dari 100 merek produk kecantikan berkualitas, terutama dari pegiat usaha lokal. Masyarakat juga dapat menikmati gratis ongkir, exclusive launch, flash sale 3x sehari termasuk 99% clearance flash sale, voucher cashback dan masih banyak lainnya.</div>\r\n</div>', 'blogpost_620210317080245.jpg', 'Kenaikan-Transaksi-Produk-Kecantikan-Hampir-2x-Lipat-Blackexpo-Store-Hadirkan-Beauty-Dealight', 0);
INSERT INTO `blw_blog` VALUES (2, '2021-03-17 07:34:03', 'Mulai Bisnis Online dengan Modal Minim, Kini Dewi Mampu Raup Omset Ratusan Juta Per Bulan', '<div>Awalnya Herlina P. Dewi sama sekali tidak terpikir untuk memulai bisnis, apalagi bisnis tersebut dilakukan secara online. Tekad untuk membuka bisnis ini datang tujuh tahun lalu, ketika ia berencana untuk memulai program kehamilan. Dewi sadar jika ia terus bekerja sebagai pegawai kantoran, akan lebih sulit baginya untuk bisa fokus pada program tersebut.</div>\r\n<div>&nbsp;</div>\r\n<div>Ia juga ingin agar ketika anaknya lahir nanti ia bisa menemani dan melihat tumbuh kembangnya setiap hari karena menurutnya kesempatan emas ini tidak akan pernah bisa digantikan oleh apapun. &ldquo;Saya melihat banyak teman di kantor tidak bisa menemani anaknya liburan sekolah karena harus bekerja. Saya tidak mau seperti itu,&rdquo; ucap Dewi.</div>\r\n<div>&nbsp;</div>\r\n<div>Dewi akhirnya memutuskan untuk berhenti bekerja dan menjalani hobinya, yaitu menulis. Tulisan-tulisan seputar pengelolaan keuangan yang kebetulan merupakan bidang yang ia tekuni kemudian diterbitkan melalui Stiletto Book, penerbitan independen garapan Dewi sendiri.</div>\r\n<div>&nbsp;</div>\r\n<div>Sejak itu, banyak penulis yang menghubungi Dewi, ingin karya-karyanya juga diterbitkan. Pemasaran buku-buku terbitan Stilleto Book dilakukan melalui media dalam jaringan, mulai dari aplikasi chatting, forum online, media sosial hingga membuka toko online di toko sendiri, seperti Blackexpo Store.</div>\r\n<div>&nbsp;</div>\r\n<div>Empat tahun berjalan, Dewi dan suami dikaruniai seorang anak, namun di sisi lain Dewi melihat kecenderungan bisnis buku yang semakin merosot. &ldquo;Padahal justru kebutuhan ketika punya anak semakin banyak,&rdquo; jelas Dewi.</div>\r\n<div>&nbsp;</div>\r\n<div>Menyiasati kondisi tersebut, Dewi melakukan ekspansi bisnis ke produk dekorasi rumah bertemakan buku, misalnya sarung bantal sofa bertuliskan Keep Calm &amp; Read Books dengan modal kurang dari Rp 1 juta. Rupanya produk ini mendapatkan respon yang sangat positif. Permintaan semakin banyak berdatangan.</div>\r\n<div>&nbsp;</div>\r\n<div>&ldquo;Banyak yang tertarik dan bahkan meminta saya untuk membuat desain lain juga, tidak hanya buku, seperti karpet bertuliskan Home Sweet Home atau hiasan dinding bermotif bunga-bunga,&rdquo; ucap Dewi.</div>\r\n<div>&nbsp;</div>\r\n<div>Ibu satu anak yang juga memiliki hobi mendesain, menjahit, hingga merajut ini kemudian melakukan banyak eksplorasi dari sisi ragam produk maupun desain. Saat ini, Stilleto Book yang awalnya menerbitkan dan menjual buku saja, menjelma menjadi sebuah toko online yang menawarkan puluhan jenis produk dekorasi rumah dengan ribuan desain menarik.</div>\r\n<div>&nbsp;</div>\r\n<div>Perempuan kelahiran Wonosobo ini merasa sangat bersyukur dengan perkembangan bisnisnya. Tidak hanya memiliki waktu berkualitas dengan keluarga, Dewi kini juga mampu memberdayakan 35 warga di sekitar rumahnya sebagai karyawan.</div>\r\n<div>&nbsp;</div>\r\n<div>&ldquo;Semua yang membantu saya di sini, mulai dari penjahit, tukang kayu, desainer, admin dan sebagainya, adalah tetangga-tetangga di sekitar rumah kami. Saya ingin memberdayakan yang terdekat terlebih dahulu.&rdquo;</div>\r\n<div>&nbsp;</div>\r\n<div>Meskipun telah merasakan manisnya berbisnis home decor, Dewi tetap menjalankan bisnis penerbitan bukunya. &ldquo;Untuk buku tetap jalan seperti biasa, karena saya ingin tetap bisa bantu orang lain dengan bacaan. Kami di Stiletto juga rutin memberikan sumbangan buku setiap bulannya ke tempat-tempat yang membutuhkan,&rdquo; ucap Dewi.</div>\r\n<div>&nbsp;</div>\r\n<div>Omzet Stiletto kini mencapai Rp 300 juta per bulan, bahkan bisa lebih besar pada momen-momen tertentu, seperti Ramadhan atau menjelang hari raya. Selain toko online, ia juga berhasil membuka toko offline di Maguwoharjo, Yogyakarta, ruang workshop khusus bagi para pengrajin untuk melakukan proses produksi, hingga kantor yang layak bagi para editor buku maupun desainer produk dekorasi rumah.</div>\r\n<div>&nbsp;</div>\r\n<div>Harapan sederhana Dewi di awal membangun bisnis pun terwujud, &ldquo;Waktu yang saya miliki bersama keluarga saat ini menjadi lebih fleksibel, terutama untuk anak. Saya bisa antar-jemput dia sekolah. Kalau liburan sekolah seperti ini juga jadi bisa liburan bersama,&rdquo; terang Dewi.</div>', 'blogpost_620210317073245.jpg', 'Mulai-Bisnis-Online-dengan-Modal-Minim-Kini-Dewi-Mampu-Raup-Omset-Ratusan-Juta-Per-Bulan', 0);
