INSERT INTO `blw_notifikasi` VALUES (22, 0, 2, '082261992391', '', '\n						*Pesanan Baru*\n*SYAHID KHUDRI* telah membuat pesanan baru dengan detail:\nTotal Pembayaran: *Rp. 7.012.717*\nInvoice ID: *#202103261717*\n \nCek Pesanan Pembeli di *Dashboard Admin GSS STORE*\n						', '', NULL, '2021-03-26 23:17:41', 0, '0000-00-00 00:00:00');
