INSERT INTO `blw_page` VALUES (8, '2021-02-05 01:07:43', 5, 'Dukungan Pengiriman', 'Dukungan-Pengiriman', '<ul>\r\n<li>Pengiriman barang untuk setiap transaksi yang terjadi melalui Platform BLACKEXPO menggunakan layanan pengiriman barang yang disediakan BLACKEXPO atas kerjasama BLACKEXPO dengan pihak jasa ekspedisi pengiriman barang resmi.</li>\r\n<li>Pengguna memahami dan menyetujui bahwa segala bentuk peraturan terkait dengan syarat dan ketentuan pengiriman barang sepenuhnya ditentukan oleh pihak jasa ekspedisi pengiriman barang dan sepenuhnya menjadi tanggung jawab pihak jasa ekspedisi pengiriman barang.</li>\r\n<li>BLACKEXPO hanya berperan sebagai media perantara antara Pengguna dengan pihak jasa ekspedisi pengiriman barang.</li>\r\n<li>Pengguna wajib memahami, menyetujui, serta mengikuti ketentuan-ketentuan pengiriman barang yang telah dibuat oleh pihak jasa ekspedisi pengiriman barang.</li>\r\n<li>Pengiriman barang atas transaksi melalui sistem BLACKEXPO menggunakan jasa ekspedisi pengiriman barang dilakukan dengan tujuan agar barang dapat dipantau melalui sistem BLACKEXPO.</li>\r\n<li>Pelapak (Penjual) wajib bertanggung jawab penuh atas barang yang dikirimnya.</li>\r\n<li>Pengguna memahami dan menyetujui bahwa segala bentuk kerugian yang dapat timbul akibat kerusakan ataupun kehilangan pada barang, baik pada saat pengiriman barang tengah berlangsung maupun pada saat pengiriman barang telah selesai, adalah sepenuhnya tanggung jawab pihak jasa ekspedisi pengiriman barang.</li>\r\n<li>Dalam hal diperlukan untuk dilakukan proses pengembalian barang, maka Pengguna, baik Pelapak (Penjual) maupun Pembeli, diwajibkan untuk melakukan pengiriman barang langsung ke masing-masing Pembeli maupun Pelapak (Penjual). BLACKEXPO tidak menerima pengembalian atau pengiriman barang atas transaksi yang dilakukan oleh Pengguna dalam kondisi apa pun.</li>\r\n</ul>', 1);
INSERT INTO `blw_page` VALUES (9, '2021-02-05 01:11:15', 5, 'Pertanyaan Umum', 'Pertanyaan-Umum', '<p>Disini adalah informasi yang menjelaskan Pertanyaan Umum</p>', 1);
INSERT INTO `blw_page` VALUES (10, '2021-02-05 01:08:36', 5, 'Syarat dan Ketentuan', 'Syarat-dan-Ketentuan', '<p>Syarat &amp; ketentuan yang ditetapkan di bawah ini mengatur pemakaian jasa yang ditawarkan oleh BLACKEXPO terkait penggunaan situs www.blackexpo.or.id.</p>\r\n<p>&nbsp;</p>\r\n<p>Pengguna disarankan membaca dengan seksama karena dapat berdampak kepada hak dan kewajiban Pengguna di bawah hukum. Dengan mendaftar dan/atau menggunakan situs www.blackexpo.or.id, maka pengguna dianggap telah membaca, mengerti, memahami dan menyutujui semua isi dalam Syarat &amp; ketentuan.</p>\r\n<p>&nbsp;</p>\r\n<p>Syarat &amp; ketentuan ini merupakan bentuk kesepakatan yang dituangkan dalam sebuah perjanjian yang sah antara Pengguna dengan ALLBATIK. Jika pengguna tidak menyetujui salah satu, sebagian, atau seluruh isi Syarat &amp; ketentuan, maka pengguna tidak diperkenankan menggunakan layanan di www.blackexpo.or.id.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>A. Definisi&nbsp;</p>\r\n<p>B. Akun, Saldo, Password dan Keamanan&nbsp;</p>\r\n<p>C. Transaksi Penjualan&nbsp;</p>\r\n<p>D. Penataan Etalase&nbsp;</p>\r\n<p>E. Komisi&nbsp;</p>\r\n<p>F. Harga&nbsp;</p>\r\n<p>G. Tarif Pengiriman&nbsp;</p>\r\n<p>H. Konten&nbsp;</p>\r\n<p>I. Jenis Barang&nbsp;</p>\r\n<p>J. Pengiriman Barang&nbsp;</p>\r\n<p>K. Penarikan Dana&nbsp;</p>\r\n<p>L. Penolakan Jaminan Dan Batasan Tanggung Jawab&nbsp;</p>\r\n<p>M. Pelepasan&nbsp;</p>\r\n<p>N. Ganti Rugi&nbsp;</p>\r\n<p>O. Pilihan Hukum&nbsp;</p>\r\n<p>P. Pembaharuan&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>A. DEFINISI&nbsp;</p>\r\n<p>1. BLACKEXPO adalah suatu platform yang menjalankan kegiatan usaha jasa web portal www.blackexpo.or.id, yakni situs pencarian toko dan Barang yang dijual oleh penjual terdaftar. Selanjutnya disebut ALLBATIK.&nbsp;</p>\r\n<p>2. Situs BLACKEXPO adalah www.blackexpo.or.id.&nbsp;</p>\r\n<p>3. Syarat &amp; ketentuan adalah perjanjian antara Pengguna dan BLACKEXPO yang berisikan seperangkat peraturan yang mengatur hak, kewajiban, tanggung jawab pengguna dan ALLBATIK, serta tata cara penggunaan sistem layanan ALLBATIK.&nbsp;</p>\r\n<p>4. Pengguna adalah pihak yang menggunakan layanan ALLBATIK, termasuk namun tidak terbatas pada pembeli, penjual ataupun pihak lain yang sekedar berkunjung ke Situs ALLBATIK.&nbsp;</p>\r\n<p>5. Pembeli adalah Pengguna terdaftar yang melakukan permintaan atas Barang yang dijual oleh Penjual di Situs ALLBATIK.&nbsp;</p>\r\n<p>6. Penjual adalah Pengguna terdaftar yang melakukan tindakan buka toko dan/atau melakukan penawaran atas suatu Barang kepada para Pengguna Situs ALLBATIK.&nbsp;</p>\r\n<p>7. Barang adalah benda yang berwujud / memiliki fisik Barang yang dapat diantar / memenuhi kriteria pengiriman oleh perusahaan jasa pengiriman Barang.&nbsp;</p>\r\n<p>8. Saldo adalah fasilitas penampungan sementara atas dana milik Pembeli dan Penjual (bukan fasilitas penyimpanan dana), yang disediakan BLACKEXPO untuk menampung pengembalian dana transaksi (refund) pembelian Barang dan dana hasil penjualan Barang pada Situs ALLBATIK. Dana ini hanya dapat digunakan kembali untuk melakukan pembelian pada Situs BLACKEXPO dan/atau ditarik ke akun bank yang terdaftar.&nbsp;</p>\r\n<p>9. Feed adalah fitur pada Situs/Aplikasi BLACKEXPO yang menampilkan konten dari Penjual, KOL, atau pihak lainnya terkait Barang tertentu.&nbsp;</p>\r\n<p>10. Key Opinion Leaders atau KOL adalah pihak yang mempromosikan Barang atau Penjual tertentu melalui Feed.&nbsp;</p>\r\n<p>11. Rekening Resmi BLACKEXPO adalah rekening bersama yang disepakati oleh BLACKEXPO dan para pengguna untuk proses transaksi jual beli di Situs ALLBATIK. Rekening resmi BLACKEXPO dapat ditemukan di halaman https://www.blackexpo.or.id/bantuan/nomor-rekening-ALLBATIK/.</p>\r\n<p>&nbsp;</p>\r\n<p>B. AKUN, SALDO, PASSWORD DAN KEAMANAN&nbsp;</p>\r\n<p>1. Pengguna dengan ini menyatakan bahwa pengguna adalah orang yang cakap dan mampu untuk mengikatkan dirinya dalam sebuah perjanjian yang sah menurut hukum.&nbsp;</p>\r\n<p>2. BLACKEXPO tidak memungut biaya pendaftaran kepada Pengguna.&nbsp;</p>\r\n<p>3. Pengguna yang telah mendaftar berhak bertindak sebagai Penjual, dengan memanfaatkan layanan buka toko.&nbsp;</p>\r\n<p>4. Pengguna yang akan bertindak sebagai Penjual diwajibkan memilih pilihan menggunakan layanan buka toko. Setelah menggunakan layanan buka toko, Pengguna berhak melakukan pengaturan terhadap item-item yang akan diperdagangkan di etalase pribadi Pengguna.&nbsp;</p>\r\n<p>5. BLACKEXPO tanpa pemberitahuan terlebih dahulu kepada Pengguna, memiliki kewenangan untuk melakukan tindakan yang perlu atas setiap dugaan pelanggaran atau pelanggaran Syarat &amp; ketentuan dan/atau hukum yang berlaku, yakni tindakan berupa memindahkan Barang ke gudang, penghapusan Barang, moderasi toko, penutupan toko, pembatalan listing, suspensi akun, dan/atau penghapusan akun pengguna.&nbsp;</p>\r\n<p>6. BLACKEXPO memiliki kewenangan untuk menutup toko atau akun Pengguna baik sementara maupun permanen apabila didapati adanya tindakan kecurangan dalam bertransaksi dan/atau pelanggaran terhadap syarat dan ketentuan ALLBATIK. Pengguna menyetujui bahwa BLACKEXPO berhak melakukan tindakan lain yang diperlukan terkait hal tersebut, termasuk namun tidak terbatas pada menolak pengajuan pembukaan toko yang baru apabila ditemukan kesamaan data.</p>\r\n<p>7. Pengguna dilarang untuk menciptakan dan/atau menggunakan perangkat, software, fitur dan/atau alat lainnya yang bertujuan untuk melakukan manipulasi pada sistem ALLBATIK, termasuk namun tidak terbatas pada :&nbsp;</p>\r\n<p>(i) manipulasi data Toko;&nbsp;</p>\r\n<p>(ii) kegiatan perambanan (crawling/scraping);&nbsp;</p>\r\n<p>(iii) kegiatan otomatisasi dalam transaksi, jual beli, promosi, dsb;&nbsp;</p>\r\n<p>(v) penambahan produk ke etalase; dan/atau&nbsp;</p>\r\n<p>(vi) aktivitas lain yang secara wajar dapat dinilai sebagai tindakan manipulasi sistem.&nbsp;</p>\r\n<p>8. BLACKEXPO memiliki kewenangan untuk melakukan penyesuaian jumlah transaksi toko, penyesuaian jumlah reputasi, dan/atau melakukan proses moderasi/menutup akun Pengguna, jika diketahui atau diduga adanya kecurangan oleh Pengguna yang bertujuan memanipulasi data transaksi Pengguna demi meningkatkan reputasi toko (review dan atau jumlah transaksi). Contohnya adalah melakukan proses belanja ke toko sendiri dengan menggunakan akun pribadi atau akun pribadi lainnya.&nbsp;</p>\r\n<p>9. Saldo berasal dari pengembalian dana transaksi (refund) pembelian dan penjualan Barang di Situs BLACKEXPO dan tidak bisa dilakukan penambahan secara sendiri (top up).&nbsp;</p>\r\n<p>10. Saldo dapat digunakan sebagai salah satu metode pembayaran atas transaksi pembelian Barang di Situs ALLBATIK, dan dapat dilakukan penarikan dana (withdrawal) ke rekening bank yang terdaftar pada akun Pengguna.&nbsp;</p>\r\n<p>11. BLACKEXPO memiliki kewenangan untuk melakukan pembekuan Saldo Pengguna apabila ditemukan / diduga adanya tindak kecurangan dalam bertransaksi dan/atau pelanggaran terhadap syarat dan ketentuan ALLBATIK.&nbsp;</p>\r\n<p>12. Penjual dilarang melakukan duplikasi toko, duplikasi produk, atau tindakan-tindakan lain yang dapat diindikasikan sebagai usaha persaingan tidak sehat.&nbsp;</p>\r\n<p>13. Pengguna tidak memiliki hak untuk mengubah nama akun, nama toko dan/atau domain toko Pengguna.&nbsp;</p>\r\n<p>14. Pengguna bertanggung jawab secara pribadi untuk menjaga kerahasiaan akun dan password untuk semua aktivitas yang terjadi dalam akun Pengguna.&nbsp;</p>\r\n<p>15. BLACKEXPO tidak akan meminta username, password milik akun Pengguna untuk alasan apapun, oleh karena itu BLACKEXPO menghimbau Pengguna agar tidak memberikan data tersebut maupun data penting lainnya kepada pihak yang mengatasnamakan BLACKEXPO atau pihak lain yang tidak dapat dijamin keamanannya.&nbsp;</p>\r\n<p>16. Pengguna setuju untuk memastikan bahwa Pengguna keluar dari akun di akhir setiap sesi dan memberitahu BLACKEXPO jika ada penggunaan tanpa izin atas sandi atau akun Pengguna.&nbsp;</p>\r\n<p>17. Pengguna dengan ini menyatakan bahwa BLACKEXPO tidak bertanggung jawab atas kerugian ataupun kendala yang timbul atas penyalahgunaan akun Pengguna yang diakibatkan oleh kelalaian Pengguna, termasuk namun tidak terbatas pada meminjamkan atau memberikan akses akun kepada pihak lain, mengakses link atau tautan yang diberikan oleh pihak lain, memberikan atau memperlihatkan password atau email kepada pihak lain, maupun kelalaian Pengguna lainnya yang mengakibatkan kerugian ataupun kendala pada akun Pengguna.&nbsp;</p>\r\n<p>18. Penjual dilarang mempromosikan toko dan/atau Barang secara langsung menggunakan fasilitas pesan pribadi, diskusi produk, ulasan produk yang dapat mengganggu kenyamanan Pengguna lain.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>C. TRANSAKSI PENJUALAN&nbsp;</p>\r\n<p>1. Penjual dilarang memanipulasi harga Barang dengan tujuan apapun.&nbsp;</p>\r\n<p>2. Penjual dilarang melakukan penawaran / berdagang Barang terlarang sesuai dengan yang telah ditetapkan pada ketentuan \"Jenis Barang\".&nbsp;</p>\r\n<p>3. Penjual wajib memberikan foto dan informasi produk dengan lengkap dan jelas sesuai dengan kondisi dan kualitas produk yang dijualnya. Apabila terdapat ketidaksesuaian antara foto dan informasi produk yang diunggah oleh Penjual dengan produk yang diterima oleh Pembeli, maka BLACKEXPO berhak membatalkan/menahan dana transaksi.&nbsp;</p>\r\n<p>4. Dalam menggunakan Fasilitas \"Judul Produk\", \"Foto Produk\", dan \"Deskripsi Produk\", Penjual dilarang membuat peraturan bersifat klausula baku yang tidak memenuhi peraturan perundang-undangan yang berlaku di Indonesia, termasuk namun tidak terbatas pada&nbsp;</p>\r\n<p>(i) tidak menerima komplain,&nbsp;</p>\r\n<p>(ii) tidak menerima retur (penukaran barang),&nbsp;</p>\r\n<p>(iii) tidak menerima refund (pengembalian dana),&nbsp;</p>\r\n<p>(iv) barang tidak bergaransi,&nbsp;</p>\r\n<p>(v) pengalihan tanggung jawab (termasuk tidak terbatas pada penanggungan ongkos kirim),&nbsp;</p>\r\n<p>(vi) penyusutan nilai harga dan&nbsp;</p>\r\n<p>(vii) pengiriman barang acak secara sepihak. Jika terdapat pertentangan antara catatan toko dan/atau deskripsi produk dengan Syarat &amp; Ketentuan ALLBATIK, maka peraturan yang berlaku adalah Syarat &amp; Ketentuan ALLBATIK.&nbsp;</p>\r\n<p>5. Penjual wajib memberikan balasan untuk menerima atau menolak pesanan Barang pihak Pembeli dalam batas waktu 2 hari terhitung sejak adanya notifikasi pesanan Barang dari ALLBATIK. Jika dalam batas waktu tersebut tidak ada balasan dari Penjual maka secara otomatis pesanan akan dibatalkan.</p>\r\n<p>6. Demi menjaga kenyamanan Pembeli dalam bertransaksi, Penjual memahami dan menyetujui bahwa BLACKEXPO berhak melakukan moderasi toko Penjual apabila Penjual melakukan penolakan, pembatalan dan/atau tidak merespon pesanan Barang milik Pembeli dengan dugaan untuk memanipulasi transaksi, pelanggaran atas Syarat dan Ketentuan, dan/atau kecurangan atau penyalahgunaan lainnya.</p>\r\n<p>7. Penjual wajib memasukan nomor resi pengiriman Barang dalam batas waktu 2 x 24 jam (tidak termasuk hari Sabtu/Minggu/libur Nasional) terhitung sejak adanya notifikasi pesanan Barang dari ALLBATIK. Jika dalam batas waktu tersebut pihak Penjual tidak memasukan nomor resi pengiriman Barang maka secara otomatis pesanan dianggap dibatalkan. Jika Penjual tetap mengirimkan Barang setelah melebihi batas waktu pengiriman sebagaimana dijelaskan diatas, maka Penjual memahami bahwa transaksi akan tetap dibatalkan untuk kemudian Penjual dapat melakukan penarikan Barang pada kurir tempat Barang dikirimkan.</p>\r\n<p>8. Penjual memahami dan menyetujui bahwa pembayaran atas harga Barang dan ongkos kirim (diluar biaya transfer / administrasi) akan dikembalikan sepenuhnya ke Pembeli apabila transaksi dibatalkan dan/atau transaksi tidak berhasil dan/atau ketentuan lain yang diatur dalam Syarat &amp; Ketentuan Poin D.</p>\r\n<p>9. Dalam keadaan Penjual hanya dapat memenuhi sebagian dari jumlah Barang yang dipesan oleh Pembeli, maka Penjual wajib membatalkan transaksi.&nbsp;</p>\r\n<p>10. BLACKEXPO memiliki kewenangan untuk menahan pembayaran dana di Rekening Resmi BLACKEXPO sampai waktu yang tidak ditentukan apabila terdapat permasalahan dan klaim dari pihak Pembeli terkait proses pengiriman dan kualitas Barang. Pembayaran baru akan dilanjut kirimkan kepada Penjual apabila permasalahan tersebut telah selesai dan/atau Barang telah diterima oleh Pembeli.&nbsp;</p>\r\n<p>11. BLACKEXPO berwenang untuk membatalkan transaksi dan/atau menahan dana transaksi dalam hal:&nbsp;</p>\r\n<p>(i) nomor resi kurir pengiriman Barang yang diberikan oleh Penjual tidak sesuai dan/atau diduga tidak sesuai dengan transaksi yang terjadi di Situs ALLBATIK;&nbsp;</p>\r\n<p>(ii) Penjual mengirimkan Barang melalui jasa kurir/logistik selain dari yang disediakan dan terhubung dengan Situs ALLBATIK;&nbsp;</p>\r\n<p>(iii) jika nama produk dan deskripsi produk tidak sesuai/tidak jelas dengan produk yang dikirim;&nbsp;</p>\r\n<p>(iv) jika ditemukan adanya manipulasi transaksi; dan/atau&nbsp;</p>\r\n<p>(v) mencantumkan nomor resi pengiriman Barang yang telah digunakan oleh Penjual lainnya.&nbsp;</p>\r\n<p>12. Penjual memahami dan menyetujui bahwa Pajak Penghasilan Penjual akan dilaporkan dan diurus sendiri oleh masing-masing Penjual sesuai dengan ketentuan pajak yang berlaku di peraturan perundang-undangan di Indonesia.&nbsp;</p>\r\n<p>13. BLACKEXPO berwenang mengambil keputusan atas permasalahan-permasalahan transaksi yang belum terselesaikan akibat tidak adanya kesepakatan penyelesaian, baik antara Penjual dan Pembeli, dengan melihat bukti-bukti yang ada. Keputusan BLACKEXPO adalah keputusan akhir yang tidak dapat diganggu gugat dan mengikat pihak Penjual dan Pembeli untuk mematuhinya.&nbsp;</p>\r\n<p>14. Apabila disepakati oleh Penjual dan Pembeli, penggunaan jasa Logistik yang berbeda dari pilihan awal pembeli dapat dilakukan (dengan ketentuan bahwa tarif pengiriman tersebut adalah dibawah tarif pengiriman awal).&nbsp;</p>\r\n<p>15. BLACKEXPO berwenang memotong kelebihan tarif pengiriman dari dana pembayaran pembeli dan mengembalikan selisih kelebihan tarif pengiriman kepada pembeli.&nbsp;</p>\r\n<p>16. Penjual memahami sepenuhnya dan menyetujui bahwa invoice yang diterbitkan adalah atas nama Penjual.&nbsp;&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>D. PENATAAN ETALASE&nbsp;</p>\r\n<p>1. Penjual dilarang mempergunakan etalase (termasuk dan tidak tebatas pada informasi toko dan informasi barang) sebagai media untuk beriklan atau melakukan promosi ke halaman situs lain diluar situs ALLBATIK.&nbsp;</p>\r\n<p>2. Penjual dilarang memberikan data kontak pribadi dengan maksud untuk melakukan transaksi secara langsung kepada Pembeli / calon Pembeli.&nbsp;</p>\r\n<p>3. Penjual dilarang memberikan keterangan (informasi toko dan/atau Barang) selain/diluar daripada keterangan toko dan/atau Barang yang bersangkutan.&nbsp;</p>\r\n<p>4. Penamaan Barang harus dilakukan sesuai dengan informasi detail, spesifikasi, dan kondisi Barang, dengan demikian Pengguna tidak diperkenankan untuk mencantumkan nama dan/atau kata yang tidak berkaitan dengan Barang tersebut.&nbsp;</p>\r\n<p>5. Penamaan Barang dan informasi produk harus sesuai dengan kondisi Barang yang ditampilkan dan Pengguna tidak diperkenankan mencantumkan nama dan informasi yang tidak sesuai dengan kondisi Barang.&nbsp;</p>\r\n<p>6. Penjual wajib memisahkan tiap-tiap Barang yang memiliki ukuran dan harga yang berbeda.&nbsp;</p>\r\n<p>7. Penjual tidak diperkenankan memperdagangkan jasa, atau Barang non-fisik.&nbsp;</p>\r\n<p>8. BLACKEXPO memiliki kewenangan mengambil-alih sub-domain toko Penjual jika akun Penjual sudah tidak aktif lebih dari 9 bulan, dan/atau pemilik merek dagang resmi (sesuai dengan Daftar Umum Merek di Indonesia) dengan nama yang sama dengan sub-domain Penjual melakukan klaim terhadapnya dikarenakan mereka ingin menggunakan sub-domain tersebut.&nbsp;</p>\r\n<p>9. BLACKEXPO memiliki kewenangan untuk mengubah nama dan/atau memakai nama Toko dan/atau domain Pengguna untuk kepentingan internal ALLBATIK.</p>\r\n<p>&nbsp;</p>\r\n<p>E. KOMISI&nbsp;</p>\r\n<p>1. BLACKEXPO memberlakukan sistem komisi untuk setiap transaksi yang dilakukan melalui Rekening Resmi BLACKEXPO sebesar 10% dari nilai transaksi.&nbsp;</p>\r\n<p>2. Dana diteruskan ke Saldo milik Penjual sebesar nilai transaksi yang sudah terpotong komisi 10% dari nilai transaksi tersebut.</p>\r\n<p>&nbsp;</p>\r\n<p>F. HARGA&nbsp;</p>\r\n<p>1. Harga Barang yang terdapat dalam situs BLACKEXPO adalah harga yang ditetapkan oleh Penjual. Penjual dilarang memanipulasi harga barang dengan cara apapun.&nbsp;</p>\r\n<p>2. Penjual dilarang menetapkan harga yang tidak wajar pada Barang yang ditawarkan melalui Situs ALLBATIK. BLACKEXPO berhak untuk melakukan tindakan berupa memindahkan Barang ke gudang, pemeriksaan, penundaan, atau penurunan konten serta tindakan lainnya berdasarkan penilaian sendiri dari BLACKEXPO atas dasar penetapan harga yang tidak wajar.&nbsp;</p>\r\n<p>3. Penjual memahami dan menyetujui bahwa kesalahan ketik yang menyebabkan keterangan harga atau informasi lain menjadi tidak benar/sesuai adalah tanggung jawab Penjual. Perlu diingat dalam hal ini, apabila terjadi kesalahan pengetikan keterangan harga Barang yang tidak disengaja, Penjual berhak menolak pesanan Barang yang dilakukan oleh pembeli.&nbsp;</p>\r\n<p>4. Pengguna memahami dan menyetujui bahwa setiap masalah dan/atau perselisihan yang terjadi akibat ketidaksepahaman antara Penjual dan Pembeli tentang harga bukanlah merupakan tanggung jawab ALLBATIK.&nbsp;</p>\r\n<p>5. Batasan harga maksimal satuan untuk Barang yang dapat ditawarkan adalah Rp. 100.000.000,- 6. Situs BLACKEXPO untuk saat ini hanya melayani transaksi jual beli Barang dalam mata uang Rupiah.</p>\r\n<p>&nbsp;</p>\r\n<p>G. TARIF PENGIRIMAN&nbsp;</p>\r\n<p>Pembeli memahami dan mengerti bahwa BLACKEXPO telah melakukan usaha sebaik mungkin dalam memberikan informasi tarif pengiriman kepada Pembeli berdasarkan lokasi secara akurat, namun BLACKEXPO tidak dapat menjamin keakuratan data tersebut dengan yang ada pada cabang setempat. Karena itu BLACKEXPO menyarankan kepada Penjual untuk mencatat terlebih dahulu tarif yang diberikan ALLBATIK, agar dapat dibandingkan dengan tarif yang dibebankan di cabang setempat. Apabila mendapati perbedaan, mohon sekiranya untuk menginformasikan kepada kami melalui menu contact us dengan memberikan data harga yang didapat beserta kota asal dan tujuan, agar dapat kami telusuri lebih lanjut. Pengguna memahami dan menyetujui bahwa selisih biaya pengiriman Barang adalah di luar tanggung jawab ALLBATIK, dan oleh karena itu, adalah kebijakan Penjual sendiri untuk membatalkan atau tetap melakukan pengiriman Barang.</p>\r\n<p>&nbsp;</p>\r\n<p>H. KONTEN&nbsp;</p>\r\n<p>1. Dalam menggunakan setiap fitur dan/atau layanan ALLBATIK, Pengguna dilarang untuk mengunggah atau mempergunakan kata-kata, komentar, gambar, atau konten apapun yang mengandung unsur SARA, diskriminasi, merendahkan atau menyudutkan orang lain, vulgar, bersifat ancaman, beriklan atau melakukan promosi ke situs selain Situs ALLBATIK, atau hal-hal lain yang dapat dianggap tidak sesuai dengan nilai dan norma sosial maupun berdasarkan kebijakan yang ditentukan sendiri oleh ALLBATIK. BLACKEXPO berhak melakukan tindakan yang diperlukan atas pelanggaran ketentuan ini, antara lain penghapusan konten, moderasi toko, pemblokiran akun, dan lain-lain.&nbsp;</p>\r\n<p>2. Pengguna dilarang mempergunakan foto/gambar Barang yang memiliki watermark yang menandakan hak kepemilikan orang lain.&nbsp;</p>\r\n<p>3. Pengguna dengan ini memahami dan menyetujui bahwa penyalahgunaan foto/gambar yang di unggah oleh Pengguna adalah tanggung jawab Pengguna secara pribadi.&nbsp;</p>\r\n<p>4. Penjual tidak diperkenankan untuk mempergunakan foto/gambar Barang atau logo toko sebagai media untuk beriklan atau melakukan promosi ke situs-situs lain diluar Situs ALLBATIK, atau memberikan data kontak pribadi untuk melakukan transaksi secara langsung kepada pembeli / calon pembeli.&nbsp;</p>\r\n<p>5. Ketika Pengguna mengunggah ke Situs BLACKEXPO dengan konten atau posting konten, Pengguna memberikan BLACKEXPO hak non-eksklusif, di seluruh dunia, secara terus-menerus, tidak dapat dibatalkan, bebas royalti, disublisensikan ( melalui beberapa tingkatan ) hak untuk melaksanakan setiap dan semua hak cipta, publisitas , merek dagang , hak basis data dan hak kekayaan intelektual yang Pengguna miliki dalam konten, di media manapun yang dikenal sekarang atau di masa depan. Selanjutnya , untuk sepenuhnya diizinkan oleh hukum yang berlaku , Anda mengesampingkan hak moral dan berjanji untuk tidak menuntut hak-hak tersebut terhadap ALLBATIK.&nbsp;</p>\r\n<p>6. Pengguna menjamin bahwa tidak melanggar hak kekayaan intelektual dalam mengunggah konten Pengguna kedalam situs ALLBATIK. Setiap Pengguna dengan ini bertanggung jawab secara pribadi atas pelanggaran hak kekayaan intelektual dalam mengunggah konten di Situs ALLBATIK.&nbsp;</p>\r\n<p>7. BLACKEXPO menyediakan fitur \"Diskusi\" untuk memudahkan pembeli berinteraksi dengan penjual, perihal Barang yang ditawarkan. Penjual tidak diperkenankan menggunakan fitur tersebut untuk tujuan dengan cara apa pun menaikkan harga Barang dagangannya, termasuk di dalamnya memberi komentar pertama kali atau memberi komentar selanjutnya / terus menerus secara berkala (flooding / spam).&nbsp;</p>\r\n<p>8. Meskipun kami mencoba untuk menawarkan informasi yang dapat diandalkan, kami tidak bisa menjanjikan bahwa katalog akan selalu akurat dan terbarui, dan Pengguna setuju bahwa Pengguna tidak akan meminta BLACKEXPO bertanggung jawab atas ketimpangan dalam katalog. Katalog mungkin termasuk hak cipta, merek dagang atau hak milik lainnya.&nbsp;</p>\r\n<p>9. Konten atau materi yang akan ditampilkan atau ditayangkan pada Situs/Aplikasi BLACKEXPO melalui Feed akan tunduk pada Ketentuan Situs, peraturan hukum, serta etika pariwara yang berlaku.&nbsp;</p>\r\n<p>10. Pengguna atau pihak lainnya yang menggunakan fitur Feed bertanggungjawab penuh terhadap konten atau materi yang diunggah melalui fitur Feed.&nbsp;</p>\r\n<p>11. BLACKEXPO berhak untuk sewaktu-waktu menurunkan konten atau materi yang terdapat pada Feed yang dianggap melanggar Syarat dan Ketentuan Situs, peraturan hukum yang berlaku, serta etika pariwara yang berlaku.</p>\r\n<p>&nbsp;</p>\r\n<p>I. JENIS BARANG&nbsp;</p>\r\n<p>Berikut ini adalah daftar jenis Barang yang dilarang untuk diperdagangkan oleh Penjual pada Situs ALLBATIK:&nbsp;</p>\r\n<p>&bull; Segala jenis obat-obatan maupun zat-zat lain yang dilarang ataupun dibatasi peredarannya menurut ketentuan hukum yang berlaku, termasuk namun tidak terbatas pada ketentuan Undang-Undang Narkotika, Undang-Undang Psikotropika, dan Undang-Undang Kesehatan. Termasuk pula dalam ketentuan ini ialah obat keras, obat-obatan yang memerlukan resep dokter, obat bius dan sejenisnya, atau obat yang tidak memiliki izin edar dari Badan Pengawas Obat dan Makanan (BPOM).&nbsp;</p>\r\n<p>&bull; Kosmetik dan makanan minuman yang membahayakan keselamatan penggunanya, ataupun yang tidak mempunyai izin edar dari Badan Pengawas Obat dan Makanan (BPOM).</p>\r\n<p>&nbsp;</p>\r\n<p>J. PENGIRIMAN BARANG&nbsp;</p>\r\n<p>A. Pengiriman Barang dalam sistem BLACKEXPO wajib menggunakan jasa perusahaan ekspedisi yang telah mendapatkan verifikasi rekanan BLACKEXPO yang dipilih oleh Pembeli.&nbsp;</p>\r\n<p>B. Penjual dilarang memberlakukan promosi / sistem bebas ongkos kirim pada setiap Barang yang dijual di dalam Situs ALLBATIK.&nbsp;</p>\r\n<p>C. Setiap ketentuan berkenaan dengan proses pengiriman Barang adalah wewenang sepenuhnya penyedia jasa layanan pengiriman Barang.&nbsp;</p>\r\n<p>D. Penjual wajib memenuhi ketentuan yang ditetapkan oleh jasa layanan pengiriman barang tersebut dan bertanggung jawab atas setiap Barang yang dikirimkan.&nbsp;</p>\r\n<p>E. Pengguna memahami dan menyetujui bahwa setiap permasalahan yang terjadi pada saat proses pengiriman Barang oleh penyedia jasa layanan pengiriman Barang adalah merupakan tanggung jawab penyedia jasa layanan pengiriman.&nbsp;</p>\r\n<p>F. Dalam hal diperlukan untuk dilakukan proses pengembalian barang, maka Pengguna, baik Penjual maupun Pembeli, diwajibkan untuk melakukan pengiriman barang langsung ke masing-masing Pembeli maupun Penjual. BLACKEXPO tidak menerima pengembalian atau pengiriman barang atas transaksi yang dilakukan oleh Pengguna dalam kondisi apapun.</p>\r\n<p>&nbsp;</p>\r\n<p>K. PENARIKAN DANA&nbsp;</p>\r\n<p>1. Penarikan dana sesama bank akan diproses dalam waktu 1x24 jam hari kerja, sedangkan penarikan dana antar bank akan diproses dalam waktu 2x24 jam hari kerja.&nbsp;</p>\r\n<p>2. Untuk penarikan dana dengan tujuan nomor rekening antar bank apabila ada biaya tambahan yang dibebankan akan menjadi tanggungan dari Pengguna.&nbsp;</p>\r\n<p>3. Dalam hal ditemukan adanya dugaan pelanggaran terhadap Syarat dan Ketentuan ALLBATIK, kecurangan, manipulasi atau kejahatan, Pengguna memahami dan menyetujui bahwa BLACKEXPO berhak melakukan tindakan pemeriksaan, pembekuan, penundaan dan/atau pembatalan terhadap penarikan dana yang dilakukan oleh Pengguna.&nbsp;</p>\r\n<p>4. Pemeriksaan, pembekuan atau penundaan penarikan dana sebagaimana dimaksud dalam poin 3 dapat dilakukan dalam jangka waktu selama yang diperlukan oleh pihak ALLBATIK.</p>\r\n<p>&nbsp;</p>\r\n<p>L. PENOLAKAN JAMINAN DAN BATASAN TANGGUNG JAWAB&nbsp;</p>\r\n<p>BLACKEXPO adalah portal web dengan model Costumer to Customer Marketplace, yang menyediakan layanan kepada Pengguna untuk dapat menjadi Penjual maupun Pembeli di website ALLBATIK. Dengan demikian transaksi yang terjadi adalah transaksi antar member ALLBATIK, sehingga Pengguna memahami bahwa batasan tanggung jawab BLACKEXPO secara proporsional adalah sebagai penyedia jasa portal web BLACKEXPO selalu berupaya untuk menjaga Layanan BLACKEXPO aman, nyaman, dan berfungsi dengan baik, tapi kami tidak dapat menjamin operasi terus-menerus atau akses ke Layanan kami dapat selalu sempurna. Informasi dan data dalam situs BLACKEXPO memiliki kemungkinan tidak terjadi secara real time. Pengguna setuju bahwa Anda memanfaatkan Layanan BLACKEXPO atas risiko Pengguna sendiri, dan Layanan BLACKEXPO diberikan kepada Anda pada \"SEBAGAIMANA ADANYA\" dan \"SEBAGAIMANA TERSEDIA\". Sejauh diizinkan oleh hukum yang berlaku, BLACKEXPO adalah tidak bertanggung jawab, dan Anda setuju untuk tidak menuntut BLACKEXPO bertanggung jawab, atas segala kerusakan atau kerugian (termasuk namun tidak terbatas pada hilangnya uang, reputasi, keuntungan, atau kerugian tak berwujud lainnya) yang diakibatkan secara langsung atau tidak langsung</p>\r\n<p>&nbsp;</p>\r\n<p>N. GANTI RUGI&nbsp;</p>\r\n<p>Pengguna akan melepaskan BLACKEXPO dari tuntutan ganti rugi dan menjaga BLACKEXPO dari setiap klaim atau tuntutan, termasuk biaya hukum yang wajar, yang dilakukan oleh pihak ketiga yang timbul dalam hal Anda melanggar Perjanjian ini, penggunaan Layanan BLACKEXPO yang tidak semestinya dan/ atau pelanggaran Anda terhadap hukum atau hak-hak pihak ketiga.</p>\r\n<p>&nbsp;</p>\r\n<p>O. PILIHAN HUKUM&nbsp;</p>\r\n<p>Perjanjian ini akan diatur oleh dan ditafsirkan sesuai dengan hukum Republik Indonesia, tanpa memperhatikan pertentangan aturan hukum. Anda setuju bahwa tindakan hukum apapun atau sengketa yang mungkin timbul dari, berhubungan dengan, atau berada dalam cara apapun berhubungan dengan situs dan/atau Perjanjian ini akan diselesaikan secara eksklusif dalam yurisdiksi pengadilan Republik Indonesia.</p>\r\n<p>&nbsp;</p>\r\n<p>P. PEMBAHARUAN&nbsp;</p>\r\n<p>Syarat &amp; ketentuan mungkin di ubah dan/atau diperbaharui dari waktu ke waktu tanpa pemberitahuan sebelumnya. BLACKEXPO menyarankan agar anda membaca secara seksama dan memeriksa halaman Syarat &amp; ketentuan ini dari waktu ke waktu untuk mengetahui perubahan apapun. Dengan tetap mengakses dan menggunakan layanan ALLBATIK, maka pengguna dianggap menyetujui perubahan-perubahan dalam Syarat &amp; ketentuan.</p>', 1);
