INSERT INTO `blw_testimoni` VALUES (1, '2020-10-22 01:43:15', 1, 'Rahayu Lestari', 'testi_1.jpg', 'Harga murah tapi kualitas jauh dari kata murah, luar biasa produknya kak juga pelayanan yang memuaskan', 'pembeli');
INSERT INTO `blw_testimoni` VALUES (2, '2020-10-22 01:43:15', 1, 'Setyo Nugroho', 'testi_2.jpg', 'Terus tingkatkan pelayanannya mas, produknya sangat bagus saya pasti akan beli lagi nanti nunggu gajian dulu hehehe', 'pembeli');
INSERT INTO `blw_testimoni` VALUES (3, '2020-10-22 01:46:59', 1, 'Wahyudi Santoso', 'testi_3.jpg', 'Dibandingkan dengan toko lain disini lebih murah dengan kualitas yang sama, goodjob ini sellernya. Lain kali gw beli disini lagi lah, respon adminnya juga cepat, thanks om', 'pembeli');
INSERT INTO `blw_testimoni` VALUES (4, '2020-10-22 01:46:59', 1, 'Maria Maryati', 'testi_4.jpg', 'Mending beli disini lah banyak promonya, kemarin beli di marketplace malah ongkirnya mahal nggk dapet subsidi pula padahal cuma beli 1 produk aja, sukses terus kak olshopnya mantab', 'pembeli');
INSERT INTO `blw_testimoni` VALUES (5, '2020-10-22 01:46:59', 1, 'Albert Wahyono', 'testi_5.jpg', 'Laris terus gan! pengalaman pertama beli di toko online yang menyenangkan ini bisa bayar pake gopay pula, produknya juga mantab kali ini', 'pembeli');
INSERT INTO `blw_testimoni` VALUES (6, '2020-10-22 01:46:59', 1, 'Siti Maesaroh', 'testi_6.jpg', 'Bagus kakak barangnya, harganya juga murah. Banyak promonya ini beli juga gratis ongkir pas lagi promo hehehe', 'pembeli');
